/***********************************************/
/*       DATA TYPES                            */
/***********************************************/

/*  Operand definition -- used in building     */
/*  format table                               */

struct k1_bitfield
{
  int size;           /* number of bits            */
  int from_offset;    /* Offset in abstract value. */
  int to_offset;      /* Offset in encoded value.  */
};

typedef struct k1_bitfield k1_bitfield_t;

struct k1_operand
{
  char *tname;                                   /* operand type name     */
  int type;                                      /* type of operand       */
  int width;                                     /* Width of the operand. */
  int rightshift;                                /* scaling amount        */
  int flags;                                     /* Can be SIGNED|CANEXTEND|BITMASK */
  int bitfields;                                 /* Number of given bitfields */
  k1_bitfield_t bfield[];  /* bitfields in most to least significant order. */
};

typedef struct k1_operand k1bfield;

/* some flags for k1_operand                                 */
/* k1SIGNED    : is this operand treated as signed ?         */
/* k1CANEXTEND : can this operand have an extension syllable */
/* k1BITMASK   : this operand is a bit mask */

#define k1SIGNED    1
#define k1CANEXTEND 2
#define k1BITMASK   4

#define k1OPCODE_FLAG_UNDEF   	0
#define k1OPCODE_FLAG_IMMX0   	1
#define k1OPCODE_FLAG_IMMX1   	2
#define k1OPCODE_FLAG_BCU   	4
#define k1OPCODE_FLAG_ALU   	8
#define k1OPCODE_FLAG_LSU   	16
#define k1OPCODE_FLAG_MAU   	32

/* Opcode definition.                          */

struct k1_codeword_s {
  unsigned int       opcode;                      /* the opcode                     */
  unsigned int       mask;                        /* disassembly mask               */
  unsigned int       flags;                       /* Target dependent flags.        */
};

typedef struct k1_codeword_s k1_codeword_t;

struct k1opc_s {
  char               *as_op;                        /* asm name                       */
  k1_codeword_t codeword[K1MAXCODEWORDS];   /* 32 bits code words.         */
  unsigned           codewords;                     /* Number of 32 bits code words.  */
  unsigned           coding_size;                   /* coding size in case of variable length. */
  int                bundlings;                     /* user specific flags            */
  int                reservation;                   /* reservation table index        */
  k1bfield *format[K1MAXOPERANDS + 1];  /* 0 terminated                   */
                                        /* list of operands               */
  char     *rclass;                     /* resource class                 */
  char     *fmtstring;                  /* formating string               */
};
typedef struct k1opc_s k1opc_t;

struct k1_core_info_s
  {
    const char *name;
    k1opc_t *optab;
    const int *resources;
    int elf_core;
    int supported;
  };

typedef struct k1_core_info_s K1_Core_Info;
struct bundletype_s
  {
    int entries;
    int bias, base;
    int nnops;
    Bundling bundling[K1MAXBUNDLESIZE];
    int nops[K1MAXBUNDLESIZE];
  };

typedef struct bundletype_s BundleType;

struct bundlematchtype_s { int entries; int entry[1]; };

typedef struct bundlematchtype_s BundleMatchType;

extern BundleType bundle_types[];
extern int bundlematch_table_size;
extern int bundlematch_table[];
extern BundleMatchType canonical_table[];

extern const int k1_resource_max;

extern const int k1_reservation_table_lines;
extern const int *k1_reservation_table_table[];
extern const char *k1_resource_names[];

extern const int k1dp_resources[];
extern k1opc_t k1dp_k1optab[];
extern const K1_Core_Info k1dp_core_info;
extern const int k1cp_resources[];
extern k1opc_t k1cp_k1optab[];
extern const K1_Core_Info k1cp_core_info;
extern const K1_Core_Info *k1_core_info_table[];

